import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
const Header = () => {
    const myStyle = {
        color: "green",
        backgroundColor: "red",
        padding: "10px",
        fontFamily: "Arial"
    };
    return (
        <>
            <h1 style={myStyle}>Arena Animation South Extension</h1>
            <p>Delhi based animation institute.</p>
        </>
    );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<Header />);
